INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (14, 1, 2.17, "ミヤコ（クリスマス）", "2024/12/31 11:59:59", 0, 119901, 450, 119901, 0, "みやこ", 119901, 119901, 1, 0, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", "2024/12/22 12:00:00", 3, 1, 0, 302, 0, 1, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (6, 1, 2.375, "シズル（ノワール）", "2025/03/15 14:59:59", 0, 120001, 450, 120001, 0, "しずる", 120001, 120001, 1, 0, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", "2025/03/10 12:00:00", 3, 5, 0, 190, 0, 5, 0);
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, 0.0, "イオ（ノワール）", "2030/12/31 15:00:00", 0, 120101, 0, 0, 0, "いお", 0, 120101, 0, 0, "", "2015/04/01 15:00:00", 3, 7, 0, 0, 0, 7, 0);
